INSERT INTO `product` VALUES (46,'Airpod Max',_binary '','Gute sound Qualitaet',423.00,123,0.00,'2025-03-25 11:27:13',34,0,0.00),(47,'Haus, Sehr Schön',_binary '','Dieses Haus mit einer sehr schönen Frabvariation hat den Massstab 1:10. Es wird in der Schweiz hergestellt.',200.00,44,0.00,'2025-03-25 12:08:58',35,0,0.00),(49,'Ein weißes T-Shirt',_binary '','Ein weißes T-Shirt',25.00,123,10.00,'2025-03-25 12:22:26',37,0,0.00),(50,'Olma Bratwurst',_binary '','Sehr fein, vorallem mit Senf',5.00,123,0.00,'2025-03-25 12:51:19',35,0,0.00),(51,'Thomy Senf',_binary '','Feiner Senf, Sehr zu Empfehlen mit einer Olma Bratwurst',5.00,250,0.00,'2025-03-25 12:53:16',35,0,0.00),(52,'Harry Potter und der Stein der Weisen',_binary '','„Harry Potter und der Stein der Weisen“ (Originaltitel: „Harry Potter and the Philosopher’s Stone“) ist der erste Band der siebenbändigen Harry-Potter-Reihe von Joanne K. Rowling. Das Buch wurde am 26. Juni 1997 beim britischen Bloomsbury-Verlag veröffentlicht und hatte eine Erstauflage von 5.650 Exemplaren, davon 500 Hardcover-Ausgaben für Bibliotheken. Die deutsche Übersetzung erschien im Juli 1998 beim Carlsen Verlag. Klaus Fritz übernahm die Übersetzung, und Sabine Wilharm gestaltete das Cover. 1997 gewann das Buch den Nestlé Smarties Book Prize und wurde 1999 für den Deutschen Jugendliteraturpreis nominiert. Weltweit wurden mehr als 120 Millionen Exemplare verkauft, und allein in deutscher Sprache mehr als 7 Millionen. 2001 wurde der Roman von Chris Columbus erfolgreich verfilmt und trug zur weltweiten Popularität der Reihe bei. Der Erfolg des ersten Bandes leitete die Entstehung einer globalen Phänomenreihe ein.',34.00,100,0.00,'2025-03-25 12:56:02',35,0,0.00),(53,'Disney 100 Lustiges Taschenbuch Box Band 01 - 10',_binary '','Die „Disney 100 Lustiges Taschenbuch Box“ umfasst die ersten zehn Bände einer besonderen Reihe, die anlässlich des 100-jährigen Jubiläums von Disney veröffentlicht wurde. Diese Box enthält die ersten zehn Ausgaben der beliebten „Lustiges Taschenbuch“-Reihe, die mit klassischen Disney-Geschichten und Illustrationen die Fans begeistern. Die Bände bieten eine Sammlung von Abenteuern mit Mickey, Donald, Goofy und anderen berühmten Disney-Charakteren, die in humorvollen und unterhaltsamen Geschichten auftreten. Die Box ist ein Sammlerstück für Disney-Fans und Taschenbuch-Liebhaber, die die Entwicklung der Disney-Comics im Laufe der Jahre schätzen. Die Bände sind liebevoll aufbereitet und bieten einen nostalgischen Rückblick auf die Anfänge des „Lustigen Taschenbuchs“. Die Box ist ein Highlight für Fans der Disney-Welt und ein idealer Einstieg in die langjährige Tradition der „Lustigen Taschenbuch“-Reihe.',125.00,300,0.00,'2025-03-25 12:58:09',35,0,0.00),(54,'iPhone 9',_binary '','Latest iPhone from apple',799.00,21,0.00,'2025-03-25 13:04:14',34,0,0.00),(55,'Airpods Pro Gen 2',_binary '','Airpods Pro Gen 2 from Grapple. Experience the best audio quality',199.00,75,0.00,'2025-03-25 13:05:16',34,0,0.00),(56,'YB Spezial Trikot',_binary '','Produktbeschrieb\nDas limitierte Spezialtrikot ist mit reflektierenden* Elementen wie dem YB-Logo, dem Nike-Swoosh, der Kerze für Freiheit von Amnesty International und feinen Streifen versehen. Der Meisterbadge und die Sponsorenaufdrucke sind mit 3D-Effekt komplett in Schwarz gehalten.\n\nDie Trikotnummern sind mit dem Hashtag #YBFOREVERYONE veredelt. Auf dem Ärmel wurde mit dem Gründungsjahr 1898 ein weiteres reflektierendes Element integriert.\n\nDie YB-Spieler tragen dieses Trikot beim Spiel YB - GC am 4. April unter dem Motto \"Gemeinsam gegen Rassismus\" und setzen gemeinsam mit Amnesty International ein Zeichen gegen Rassismus, Antisemitismus, Homophobie, Sexismus und Diskriminierung jeglicher Art und für eine vielfältige und offene Gesellschaft.',80.00,125,0.00,'2025-03-25 13:05:53',35,0,0.00),(57,'Nike Barcelona Away Gavi 30 Shirt 2022-2023',_binary '','Nike Barcelona Away Gavi 30 Shirt 2022-2023 Original from Barcelona',70.00,10,80.00,'2025-03-25 13:15:58',35,0,0.00),(58,'Dyson Airwrap',_binary '','Der **Dyson Airwrap** ist ein innovatives Styling-Gerät, das Haarpflege und -styling revolutioniert. Mit fortschrittlicher Luftstromtechnologie ermöglicht der Airwrap das Stylen von Haaren ohne extreme Hitze, wodurch Haarschäden minimiert werden. Das Gerät nutzt die sogenannte „Air Multiplier“-Technologie, die einen kräftigen Luftstrom erzeugt, um Haare zu locken, zu glätten oder Volumen zu verleihen – ganz nach Wunsch. Der Dyson Airwrap wird mit verschiedenen Aufsätzen geliefert, darunter Lockenstäbe, Bürsten und ein glättender Aufsatz, sodass er für alle Haartypen und Styling-Bedürfnisse geeignet ist. Seine benutzerfreundliche Handhabung und die Möglichkeit, sowohl trockene als auch feuchte Haare zu stylen, machen ihn zu einem vielseitigen und praktischen Gerät. Der Airwrap zeichnet sich zudem durch seine schnelle Styling-Zeit aus und bietet langanhaltende Ergebnisse ohne schädliche Hitzeschäden. Ein Must-have für alle, die Wert auf effizientes und gesundes Haarstyling legen.',450.00,150,0.00,'2025-03-25 13:17:38',35,0,0.00),(59,'HIENA PRO Hair Clippers',_binary '','【Perfect Haircut Set】：Adjustable blade professional hair clippers easily cut all hair types and lengths, and the t-blade trimmer is used for extremely close trimming, crisp lining, and sideburns. Perfect for all clipping and trimming needs',99.99,15,0.00,'2025-03-25 13:18:58',35,0,0.00),(60,'Migros Eistee Zitrone 10x 1 Liter',_binary '','Migros Eistee Lemon ist eine erfrischende Variante des beliebten Eistees mit einem spritzigen Zitronengeschmack. Er kombiniert Schwarztee mit natürlichem Zitronensaft und bietet ein ausgewogenes, frisches Geschmackserlebnis. Der Eistee ist perfekt für heiße Tage und eignet sich gut als Durstlöscher. Zudem ist er in verschiedenen Größen erhältlich, sodass du je nach Bedarf eine kleine oder größere Flasche wählen kannst. Wenn du auf der Suche nach einer leckeren, kalorienarmen Erfrischung bist, ist der Migros Eistee Lemon eine gute Wahl!',6.50,400,0.00,'2025-03-25 13:21:21',35,0,0.00),(61,'Frischer Döner',_binary '','Ein frischer Döner ist eine köstliche und beliebte Mahlzeit, die in vielen Ländern ein Favorit ist. Der Döner besteht normalerweise aus saftigem, gegrilltem Fleisch – oft Lamm, Huhn oder Rind – das auf einem Spieß geschichtet und langsam gegrillt wird. Das Fleisch wird in dünnen Scheiben abgeschnitten und in einem warmen Fladenbrot oder Pita serviert. Dazu kommen frische Zutaten wie knackiges Gemüse (Salat, Tomaten, Zwiebeln, Gurken), eine Auswahl an Soßen (zum Beispiel Knoblauchsoße, Joghurtsoße oder scharfe Soße) und manchmal auch Feta oder Oliven.\n\nEin frischer Döner wird direkt nach der Zubereitung serviert und ist besonders schmackhaft, wenn alle Zutaten gut aufeinander abgestimmt sind. Der Döner ist nicht nur lecker, sondern auch eine schnelle, sättigende Mahlzeit für zwischendurch.',9.99,20,10.00,'2025-03-25 13:22:44',35,0,0.00),(62,'Dr Oetker Mozzarella Pizza',_binary '','Die **Dr. Oetker Mozzarella Pizza** ist eine beliebte Tiefkühlpizza, die für ihren leckeren Geschmack und die hohe Qualität bekannt ist. Der Teig ist schön dünn und knusprig, und die Pizza ist großzügig mit hochwertigem Mozzarella-Käse belegt. Der Käse schmilzt beim Backen perfekt und sorgt für eine cremige, herzhaft leckere Textur. Oft wird sie zusätzlich mit Tomatensauce und weiteren frischen Zutaten wie Kräutern oder einer dünnen Schicht Olivenöl verfeinert.\n\nIdeal für einen schnellen Snack oder eine unkomplizierte Mahlzeit, bietet die Dr. Oetker Mozzarella Pizza ein gutes Preis-Leistungs-Verhältnis. Sie ist in verschiedenen Größen erhältlich und lässt sich einfach im Ofen zubereiten. Besonders für Fans des klassischen italienischen Geschmacks ist diese Pizza eine tolle Wahl.',5.00,500,0.00,'2025-03-25 13:24:05',35,0,0.00);
INSERT INTO `product` VALUES (63,'John Deere Rasentraktor X107',_binary '','Ein **John Deere Rasentraktor** ist ein leistungsstarkes Gerät für das effiziente Mähen von größeren Rasenflächen. Diese Traktoren sind bekannt für ihre hohe Qualität, Langlebigkeit und robusten Motoren, die eine gleichmäßige Schnittleistung bieten. Mit verschiedenen Mähdeckgrößen und der Möglichkeit zur Mulch-Funktion oder Auffangbehälter bietet der Traktor Flexibilität bei der Rasenpflege. Die Modelle verfügen über komfortable Sitze, eine einfache Steuerung und ein Hydrostatikgetriebe, das stufenloses Fahren ermöglicht. Viele Traktoren lassen sich mit zusätzlichem Zubehör wie Anhängern, Schneeschiebern oder Laubsaugern erweitern. Ideal für größere Gärten, Parkflächen oder landwirtschaftliche Flächen, bieten John Deere Rasentraktoren eine langlebige, wartungsfreundliche Lösung für eine schnelle und präzise Rasenpflege. Sie sind eine ausgezeichnete Wahl für alle, die Wert auf Qualität und Leistung legen.',4000.00,25,0.00,'2025-03-25 13:44:29',35,0,0.00),(64,'BMW M v8 Hybrid',_binary '','Verkaufe meinen BMW v8 in topp Qualität. Das Auto wurde kaum gefahren. Der Preis ist verhandelbar und ich bin offen für Vorschläge. Das Auto kommt mit 27L Benzin und neuen Reifen. Nur Abholung!',99999.00,1,100.00,'2025-03-25 13:44:49',38,0,0.00),(65,'Nerf Mega Mastodon',_binary '','N-Strike Elite Blaster und Elite-Darts liefern die ultimative Blaster-Performance\nMega Series Blaster verfügen über Mega Whistler Darts, die durch die Luft schreien\nVerteidigen Sie sich mit ZombieStrike Blastern gegen eine Zombie-Invasion\nEntzünden Sie die Nacht mit FireVision Sportausrüstung, die beim Werfen leuchtet\nErhöhen Sie Ihr Spiel mit dem Pro-Grip Fußball und Nerfoop Basketball-Set',100.00,500,0.00,'2025-03-25 13:47:58',35,0,0.00),(66,'Feenstaub',_binary '','**Feenstaub** ist ein zauberhafter Begriff, der oft mit Magie und Fantasie in Verbindung gebracht wird. In vielen Märchen und Geschichten symbolisiert Feenstaub die Kraft, Wünsche zu erfüllen oder magische Veränderungen herbeizuführen. Der Staub wird häufig von Feen oder magischen Wesen verwendet, um besondere Kräfte zu verleihen, wie das Fliegen oder das Verwandeln von Dingen. In modernen Erzählungen wird Feenstaub oft als funkelndes, glitzerndes Element dargestellt, das eine geheimnisvolle und schöne Aura verbreitet. Der Begriff hat auch eine symbolische Bedeutung und steht für das Unmögliche oder Wunderbare, das mit ein wenig Magie möglich wird. Feenstaub ist in vielen Geschichten ein wichtiges magisches Werkzeug, das die Fantasie anregt und eine Welt voller Wunder und Möglichkeiten eröffnet.',7.00,1000,0.00,'2025-03-25 13:54:06',40,0,0.00),(67,'Haus mit rasen',_binary '','Ein schönes haus mit viel Land um zu buddeln',10000.00,1,0.00,'2025-03-25 14:34:05',37,0,0.00),(68,'Bershka Blue Jeans',_binary '','Blue baggy jeans \n#streetwear\n#blue\n#idk',29.00,52,5.00,'2025-03-25 14:34:34',34,0,0.00),(69,'Paco Rabanne Invictus',_binary '','Baba Perfume',120.00,600,0.00,'2025-03-25 14:40:58',40,0,0.00),(70,'Schnitzel',_binary '','Sehr Feines Schnitzel vom SV Restaurant Engehalde Bern. Erhältlich nur jeden Freitag',15.30,700,0.00,'2025-03-25 14:55:32',40,0,0.00),(71,'Botanischer Garten Bern',_binary '','Sehr exotischer Garten mit verschieden Pflanzen und Blumen. Preis vorort verhandelbar',50000.00,1,0.00,'2025-03-25 15:09:09',41,0,0.00);
